import React from "react";
// import Result from "../Result";
import "./search.css";


const Search = () => {
        return (
            <div>
            <div className="searchInput">
            <form>
            <label htmlfor="searchInput1">Book Search!</label>
                <input type="text" name="bookInput" className="form-control" id="exampleInputEmail1">
                </input>
                <button id="button" className="btn btn-primary">Search!</button>
            </form>
            </div>
            </div>
        );
}

export default Search;
